import React, { useState } from 'react';
import './SignupForm.css';

const SignupForm = () => {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    agreeToTerms: false
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prevData => ({
      ...prevData,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Form submitted:', formData);
    // In a real app, you would send this data to your backend
    alert('Account creation would be processed here!');
  };

  const handleGoogleSignup = () => {
    console.log('Google signup clicked');
    alert('This would initiate Google OAuth flow');
  };

  const handleAppleSignup = () => {
    console.log('Apple signup clicked');
    alert('This would initiate Apple OAuth flow');
  };

  return (
    <div className="signup-container">
      <div className="signup-form-wrapper">
        <div className="signup-header">
          <h1>Create an account</h1>
          <p className="login-link">
            Already have an account? <a href="/login">Log in</a>
          </p>
        </div>

        <form className="signup-form" onSubmit={handleSubmit}>
          <div className="form-row">
            <div className="form-group">
              <label htmlFor="firstName">First name</label>
              <input
                type="text"
                id="firstName"
                name="firstName"
                value={formData.firstName}
                onChange={handleChange}
                placeholder="Enter your first name"
                required
              />
            </div>
            <div className="form-group">
              <label htmlFor="lastName">Last name</label>
              <input
                type="text"
                id="lastName"
                name="lastName"
                value={formData.lastName}
                onChange={handleChange}
                placeholder="Enter your last name"
                required
              />
            </div>
          </div>

          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="Enter your email"
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="password">Password</label>
            <input
              type="password"
              id="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              placeholder="Enter your password"
              required
            />
          </div>

          <div className="checkbox-group">
            <input
              type="checkbox"
              id="agreeToTerms"
              name="agreeToTerms"
              checked={formData.agreeToTerms}
              onChange={handleChange}
              required
            />
            <label htmlFor="agreeToTerms">
              I agree to the <a href="/terms">Terms & Conditions</a>
            </label>
          </div>

          <button type="submit" className="create-account-btn">
            Create account
          </button>
        </form>

        <div className="divider">
          <span>Or register with</span>
        </div>

        <div className="social-signup">
          <button 
            type="button" 
            className="social-btn google-btn"
            onClick={handleGoogleSignup}
          >
            <span className="social-icon">G</span>
            Google
          </button>
          <button 
            type="button" 
            className="social-btn apple-btn"
            onClick={handleAppleSignup}
          >
            <span className="social-icon">ï£¿</span>
            Apple
          </button>
        </div>
      </div>

      <div className="signup-sidebar">
        <div className="sidebar-content">
          <h2>Creating Moments, Creating Memories</h2>
          <p>Join our community and start capturing your precious moments today.</p>
        </div>
      </div>
    </div>
  );
};

export default SignupForm;
